  return (
    <div className="game-background">
      <div className="container mt-5">
        <div className="row justify-content-center">
          <div className="col-md-10">
            <div className="embed-responsive embed-responsive-16by9 shadow-lg rounded">
              <iframe frameborder="0" src="https://itch.io/embed-upload/8591120?color=333333" allowfullscreen="" width="1280" height="740"><a href="https://jicortez.itch.io/testhtml">Play Test on itch.io</a></iframe>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Game;
